import React from 'react';

const HomeComponent = () => {
    return ( <>
        <div className='container'>
            <div className='heading'>
                <p className='display'>Deliver accurate and timely health care.</p>
                <p className='title'>A trustworthy healthcare campanion. We really care about your health and consiousness. </p>
            </div>
            <div className='image'></div>
        </div>
    </> );
}

export default HomeComponent;
